import React from 'react';
import { Box, Typography, Grid } from '@mui/material';
import { styled } from '@mui/system';
import FavoriteBorderIcon from '@mui/icons-material/FavoriteBorder';

// Import the images
import s1s from '../assets/s1.jpg';
import s2s from '../assets/s2.jpg';
import s3s from '../assets/s3.jpg';
import s4s from '../assets/s4.jpg';
import s5s from '../assets/s5.jpg';
import s6s from '../assets/s6.jpg';
import s7s from '../assets/s7.jpg';
import s8s from '../assets/s8.jpg';
import s9s from '../assets/s9.jpg';

// Updated sample data with imported images
const mensClothingItems = [
  {
    name: 'The Iconic Mesh Polo Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$100.00',
    discountedPrice: '$69.89',
    image: s1s,
    colors: 47,
  },
  {
    name: 'The Iconic Oxford Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$126.00',
    discountedPrice: '$99.89',
    image: s2s,
    colors: null,
  },
  {
    name: 'Textured Cotton-Linen Sweater',
    brand: 'Polo Ralph Lauren',
    price: '$125.00',
    image: s3s,
    colors: 5,
  },
  {
    name: 'The Iconic Mesh Polo Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$100.00',
    discountedPrice: '$69.89',
    image: s4s,
    colors: 47,
  },
  {
    name: 'The Iconic Oxford Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$126.00',
    discountedPrice: '$99.89',
    image: s5s,
    colors: null,
  },
  {
    name: 'Textured Cotton-Linen Sweater',
    brand: 'Polo Ralph Lauren',
    price: '$125.00',
    image: s6s,
    colors: 5,
  },
  {
    name: 'The Iconic Mesh Polo Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$100.00',
    discountedPrice: '$69.89',
    image: s7s,
    colors: 47,
  },
  {
    name: 'The Iconic Oxford Shirt - All Fits',
    brand: 'Polo Ralph Lauren',
    price: '$126.00',
    discountedPrice: '$99.89',
    image: s8s,
    colors: null,
  },
  {
    name: 'Textured Cotton-Linen Sweater',
    brand: 'Polo Ralph Lauren',
    price: '$125.00',
    image: s9s,
    colors: 5,
  },
];

// Styled components for the layout
const ItemImageContainer = styled(Box)({
  position: 'relative',
  width: '100%',
});

const ItemImage = styled('img')({
  width: '100%',
  height: '400px',
  objectFit: 'cover',
});

const FavoriteIcon = styled(FavoriteBorderIcon)({
  position: 'absolute',
  bottom: '10px',
  right: '10px',
  color: '#000',
  fontSize: '20px',
  cursor: 'pointer',
});

const MensPage = () => {
  return (
    <Box sx={{ padding: '20px', maxWidth: '1440px', margin: '0 auto' }}>
      {/* Page Header */}
      <Typography variant="h4" sx={{ fontWeight: 'bold', marginBottom: '20px' }}>
        Men's Clothing
      </Typography>

      {/* Highlighted Category */}
      <Typography variant="h6" sx={{ marginBottom: '20px', fontWeight: 'bold' }}>
        The Iconic Mesh Polo Shirt - All Fits
      </Typography>

      {/* Clothing Items Grid */}
      <Grid container spacing={3}>
        {mensClothingItems.map((item, index) => (
          <Grid item xs={12} sm={6} md={3} key={index}>
            <Box sx={{ textAlign: 'left' }}>
              <ItemImageContainer>
                <ItemImage src={item.image} alt={item.name} />
                <FavoriteIcon />
              </ItemImageContainer>
              <Typography
                variant="body2"
                sx={{
                  fontWeight: 'bold',
                  marginTop: '10px',
                  textTransform: 'uppercase',
                }}
              >
                {item.name}
              </Typography>
              <Typography
                variant="caption"
                sx={{
                  color: 'text.primary',
                  textTransform: 'uppercase',
                  display: 'block',
                  marginBottom: '5px',
                }}
              >
                {item.brand}
              </Typography>
              <Box sx={{ display: 'flex', gap: '10px', marginTop: '5px' }}>
                <Typography
                  variant="body1"
                  sx={{
                    fontWeight: 'bold',
                    textDecoration: item.discountedPrice ? 'line-through' : 'none',
                    color: item.discountedPrice ? 'text.secondary' : 'text.primary',
                  }}
                >
                  {item.price}
                </Typography>
                {item.discountedPrice && (
                  <Typography variant="body1" sx={{ fontWeight: 'bold', color: 'red' }}>
                    {item.discountedPrice}
                  </Typography>
                )}
              </Box>
              {item.colors && (
                <Typography variant="caption" sx={{ marginTop: '5px', color: 'text.secondary' }}>
                  {item.colors} colors available
                </Typography>
              )}
            </Box>
          </Grid>
        ))}
      </Grid>
    </Box>
  );
};

export default MensPage;
